<script>
import * as d3Base from "d3";
    export default {
        name: 'MainMap',
        data() {
          return {
            publicPath: process.env.BASE_URL, // this is need for the data files in the public folder, this allows the application to find the files when on different deployment roots
            d3: null // this is used so that we can assign d3 plugins to the d3 instance
          }
        },
       mounted() {
        this.d3 = Object.assign(d3Base); // this loads d3 plugins with webpack
        this.makeFireBurn();  // begin script when window loads
       },
      methods: {
        makeFireBurn() {
          const self = this;

          var yearDuration = 500
          var yearStart = 1984

          var fire_map = this.d3.select("fire_timeseries");

          // function to change color of each year grouping in stagger
          function changeElementColorHilite(mapElement, barChartElement, scatterChartElement, textElement){
            mapElement
              .style('fill', "rgb(0,0,0,0)")
            .transition().duration(500)
              .delay(function(d,i){ return yearDuration*i; })
              .style("fill", " rgb(250,109,49)");

            barChartElement
              .style('fill', "rgb(0,0,0,0)")
            .transition().duration(500)
              .delay(function(d,i){ return yearDuration*i; })
              .style("fill", "rgb(250,109,49)");

            scatterChartElement
            .style('fill', "rgb(0,0,0,0)")
            .transition().duration(500)
              .delay(function(d,i){ return yearDuration*i; })
              .style("fill", " rgb(250,109,49)");

            textElement
            .style('fill', "rgb(0,0,0,0)")
            .style('stroke', "rgb(0,0,0,0)")
            .attr("font-size", "40px")
            .attr('x', 550)
            .attr('y', 50)
            .transition()
              .delay(function(d,i){ return yearDuration*i; })
              .style("fill", "rgb(250,109,49)");

          }
          //turn past years same color
          function changeElementColorStay(mapElement, barChartElement, scatterChartElement, textElement){
            mapElement
            .transition().duration(300)
              .delay(function(d,i){ return yearDuration+yearDuration*i; })
              .style("fill", "rgba(245,169,60,0.5)")

            barChartElement
            .transition().duration(300)
              .delay(function(d,i){ return yearDuration+yearDuration*i; })
              .style("fill", "rgba(245,169,60,0.5)")

            scatterChartElement
            .transition().duration(300)
              .delay(function(d,i){ return yearDuration+yearDuration*i; })
              .style("fill", "rgba(245,169,60,0.5)")

              textElement
              .transition().duration(250)
                .delay(function(d,i){ return yearDuration+yearDuration*i; })
                .style("fill", "rgba(0,0,0,0)")

          };
        changeElementColorHilite(this.d3.selectAll(".fire"), this.d3.selectAll(".fire-bars").selectAll("rect"), this.d3.selectAll(".fire-points").selectAll("circle"), this.d3.selectAll(".text-year"));
        changeElementColorStay(this.d3.selectAll(".fire"), this.d3.selectAll(".fire-bars").selectAll("rect"), this.d3.selectAll(".fire-points").selectAll("circle"), this.d3.selectAll(".text-year"));

      
      }
    }
    }
      
</script>

